import { useState, useEffect } from "react";
import Nav from "../Nav/Nav";


const AddActivity = () => {
    const [activities, setActivities] = useState(
        {
            name: null,
            difficulty: 3,
            duration: null,
            season: 'summer',
            countries: ''
        })


    return(
        <div>
            <Nav/>
            <h1>New activity</h1>

        </div>
    )
};

export default AddActivity;
